%[text] # Proyecto Global de Asignatura
%[text] ## Rubén A. y David A. \- Otoño 2024
decimales = 5;             % Decimales a mostrar
muestras_para_media = 50;  % Muestras del final de las respuestas a tener en cuenta para las medias
aproximacion = -3;         % Aproximación del ln(0.05)
%%
%[text] ## Fase 1 \- Caracterización de la planta
%[text] **Ejercicio 1**
%[text] Capture y caracterice la salida de la planta en función de la tensión de entrada con un procedimiento análogo al empleado en la Práctica 2 y obtenga su función de transferencia (FdeT) en las unidades que considere más adecuadas para trabajar en el desarrollo de todo el diseño.
ficheros = dir("Fase1/sin_perturbacion/");

funciones_de_transferencia = {};
Kms  = {};
taus = {};
tiempos_de_interes = {};
salidas_de_interes = {};
amplitudes_escalon = {};

for i = 1:length(ficheros) %[output:group:6f221bb3]
    fichero = ficheros(i).name;

    % Saltar '.' y '..'
    if strcmp(fichero, '.') || strcmp(fichero, '..')
        continue;
    end
    str_amplitud_escalon = strsplit(fichero, '_'); str_amplitud_escalon = str_amplitud_escalon{end};
    amplitud_escalon = str2double(regexprep(str_amplitud_escalon, '[^-\d]', ''));

    escalon_sin_perturbacion = load("Fase1/sin_perturbacion/" + fichero);
    Ts = 35e-3;

    tiempo     = escalon_sin_perturbacion(:, 1);
    referencia = escalon_sin_perturbacion(:, 2);
    salida     = escalon_sin_perturbacion(:, 3);

    x_ini = find(abs(referencia) > 0, 1, 'first') + 1; % Se suma 1 ya que se tienen dos retardos y se va a trabajar
    % con una aproximación de primer orden
    x_fin = length(referencia);

    t_ini = tiempo(x_ini);
    t_fin = tiempo(end);

    t_interes = tiempo(x_ini:x_fin) - tiempo(x_ini);
    c_interes = salida(x_ini:x_fin);

    tiempos_de_interes{end + 1} = t_interes;
    salidas_de_interes{end + 1} = c_interes;
    amplitudes_escalon{end + 1} = amplitud_escalon;

    c_inf = mean(c_interes(end-muestras_para_media, end));

    ks = find(abs(c_interes) >= abs(0.95*c_inf), 1, 'first') - 1;
    ts = ks*Ts;

    figure %[output:6087de63] %[output:86a5ebab] %[output:0409f99f] %[output:3e5ff334]
    hold on %[output:6087de63] %[output:86a5ebab] %[output:0409f99f] %[output:3e5ff334]
    stairs(t_interes, c_interes)
    plot([0 t_fin - t_ini], 0.95*c_inf*[1 1], 'r:')
    xlim([0 5])
    ylim(1.1 * [min(0, c_inf) max(0, c_inf)])
    title("Respuesta al escalón de " + str_amplitud_escalon + " de la planta")
    xlabel("Tiempo (s)")
    ylabel("Velocidad escalera (m/s)")

    Km = c_inf/amplitud_escalon;
    tau = -ts/aproximacion;

    Kms{end + 1}  = Km;
    taus{end + 1} = tau;

    syms s
    funciones_de_transferencia{end + 1} = Km/(tau*s + 1);

    fprintf("Escalón de %d V.\n\tMedia de las últimas %d muestras = %.0" + decimales + "f m/s\n\tts  = %.0" ... %[output:843ad4c6] %[output:0812d85a] %[output:07a89660] %[output:5b70b120]
        + decimales + "f s\n\tKm  = %.0" + decimales + "f m/s/V\n\ttau = %.0" + decimales + "f s", ... %[output:843ad4c6] %[output:0812d85a] %[output:07a89660] %[output:5b70b120]
        amplitud_escalon, muestras_para_media, c_inf, ts, Km, tau) %[output:843ad4c6] %[output:0812d85a] %[output:07a89660] %[output:5b70b120]

end %[output:group:6f221bb3]

fprintf("Funciones de transferencia:") %[output:6ff7c4d0]
vpa(funciones_de_transferencia, decimales) %[output:08d2af40]

fprintf("Funcion de transferencia media:") %[output:384745d9]
Km  = mean(cell2mat(Kms));
tau = mean(cell2mat(taus));

syms s
G = Km/(tau*s + 1);
vpa(G, decimales) %[output:7cdea81f]
fprintf("Valores de la función media:\n\tKm  = %.0" + decimales + "f m/s/V\n\ttau = %.0" + decimales + "f s", Km, tau) %[output:4ba30451]
%%
%[text] **Ejercicio 2**
%[text] Corrobore la validez del modelo mediante su simulación en Matlab/Simulink, como también se hizo en la Práctica 2
if ~exist("tiempos_sim", 'var') %[output:group:8624090a]
    open_system("Fase1/ejercicio2")
    set_param("ejercicio2/Escalera mecánica", 'Numerator', string(Km), 'Denominator', '[' + string(tau) + ' 1' + ']')
    
    sim_len = 150;
    tiempos_sim = zeros(sim_len, 1);
    salidas_sim = zeros(sim_len,1);
    for i = 1:length(ficheros)
        fichero = ficheros(i).name;
    
        % Saltar '.' y '..'
        if strcmp(fichero, '.') || strcmp(fichero, '..')
            continue;
        end
    
        str_amplitud_escalon = strsplit(fichero, '_'); str_amplitud_escalon = str_amplitud_escalon{end};
        amplitud_escalon = str2double(regexprep(str_amplitud_escalon, '[^-\d]', ''));
    
        set_param("ejercicio2/Consigna (V)", 'After', string(amplitud_escalon))
        sim("ejercicio2")
    
        tiempos_sim(:, i - 2) = salidaEscalonMotor(1:sim_len, 1);
        salidas_sim(:, i - 2) = salidaEscalonMotor(1:sim_len, 2); %[output:23773a1b] %[output:4da7ebe8] %[output:035bb473] %[output:1b4e09e7]
    end
end %[output:group:8624090a]
for i = 1:(length(ficheros)-2) %[output:group:39317940]
    [c_ind, t_ind] = step(amplitud_escalon * tf(Kms{i}, [taus{i} 1]), 5);
    t_sim = tiempos_sim(:,i);
    c_sim = salidas_sim(:,i);
    figure %[output:5195b7e3] %[output:3623295d] %[output:5cb6ebe4] %[output:31c2aa8a]
    hold on %[output:5195b7e3] %[output:3623295d] %[output:5cb6ebe4] %[output:31c2aa8a]
    title("Comparación modelos con Simulink (" + str_amplitud_escalon + ")")
    plot(t_ind, c_ind)
    plot(t_sim, c_sim)
    plot(tiempos_de_interes{i}, salidas_de_interes{i})
    legend('Modelo individual', 'Modelo medio', 'Medidas reales','Location','southeast')
    xlim([0 5])
    xlabel("Tiempo (s)")
    ylabel("Velocidad escalera (m/s)")
end %[output:group:39317940]
%%
%[text] **Ejercicio 3**
%[text] Proponga e implemente los siguientes experimentos para caracterizar las alinealidades de la planta:
%[text] 1. Para modelar la saturación excite el SM con grandes tensiones
%[text] 2. Para modelar la zona muerta excite el SM con pequeñas tensiones. \
%[text] Debe de obtener los valores adecuados con sus unidades de la saturación y zona muerta, explicando el procedimiento de obtención, y añadir al modelo de Simulink los bloques de las alinealidades caracterizadas convenientemente colocadas y con coherencia de unidades.
% Medida de saturación
% Se incrementa la ganancia y se pone el valor máximo de entrada.
% Se obtiene el valor máximo de salida, que resulta ser igual para ambas direcciones.
c_max_abs = 2.11;
fprintf("Saturación. Valor máximo de módulo de salida: |c_max| = %.02f m/s", c_max_abs) %[output:12bb6036]

% Medida de zona muerta
% Partiendo desde cero, se disminuye la ganancia y se va incrementando la entrada gradualmente hasta que se tiene movimiento (salida != 0)
deadzone_in_pos = 0.21;
deadzone_in_neg = -0.19;
fprintf("Zona muerta. Valor mínimo de entrada. Asimétrico. DeadZone: (%.02f, %.02f) V", deadzone_in_neg, deadzone_in_pos) %[output:4f311236]

% La zona muerta resta un valor fijo a la entrada, por lo que hay que
% compensar otra vez la Km.

% Km' = salida/(entrada - deadzone) = Km/(1-dz/entrada)
km_comps = zeros(1, length(amplitudes_escalon));
for i = 1:length(km_comps)
    if amplitudes_escalon{i} > 0
        dz = deadzone_in_pos;
    else
        dz = deadzone_in_neg;
    end

    km_comps(i) = Kms{i}/(1-dz/amplitudes_escalon{i});
end

km_comp = mean(km_comps);

fprintf("Nueva aproximación de la planta teniendo en cuenta la zona muerta [m/s/V]. Solo afecta a Km, no la tau") %[output:55f82ecb]
syms s
Gcomp = km_comp/(tau*s + 1);
vpa(Gcomp, decimales) %[output:4dda269f]
%%
%[text] **Ejercicio 4**
%[text] Calcule el equivalente discreto de la planta y caracterice teóricamente su respuesta ante entrada escalón, tanto en régimen permanente como transitorio.
% Se añade un retraso para tener en cuenta el que se quitó en el ejercicio
% 1. Esto es debido a que la planta real es de segundo orden mientras que
% se aproxima con una de primero.

% BoG = ((1-z^(-1)) * sum_(Polos G(s)/s) Res[G(s)/(s*(1-exp(s*Ts)*z^(-1))]) * (1/z)
BoG = zpk(series(c2d(tf(Km, [tau 1]), Ts), tf(1, [1 0], Ts))) %[output:3d57f365]
[~, zp, ~] = zpkdata(BoG, 'v');

c_disc_inf = dcgain(BoG); % lim(z->1) BoG
ks_disc = ceil(aproximacion / log(abs(max(zp)))) + (length(zp) - 1); % Teniendo en cuenta el retardo
ts_disc = Ts * ks_disc;

fprintf("Parámetros del BoG: \n\tc_inf = %.0" + decimales + "f m/s\n\tks = %d\n\tts = %.0"+decimales+"f s", c_disc_inf, ks_disc, ts_disc) %[output:9cdc37b7]
%%
%[text] **Ejercicio 5**
pert10personas = 0.2;

% Con el número máximo de personas, el escalón unidad no es suficiente para iniciar el movimiento positivo.
% La perturbación máxima para el valor positivo es de -0.2m/s, valor con módulo superior a la salida frente al escalón unidad (0.1993 m/s).
c_inf_pert_pos = max([0, Km*1 - pert10personas]);
% Sin embargo, en el movimiento negativo, la perturbación ""ayuda"" a bajar, por lo que el valor final será de:
c_inf_pert_neg = min([0, Km*(-1) - pert10personas]);

fprintf("Desplazamiento con escalón de 1V y 10 personas:  c = %.02f", c_inf_pert_pos) %[output:946b9e11]
fprintf("Desplazamiento con escalón de -1V y 10 personas: c = %.02f", c_inf_pert_neg) %[output:0d44d5da]
%%
%[text] ## Fase 2
%[text] **Ejercicio 6**
%[text] Calcule la FdeT del regulador con sus correspondientes unidades, mediante la aplicación detallada del método directo, el resultado debe presentarlo de la forma factorizada, polinomial y con potencias negativas en z. Presente la ecuación en diferencias del regulador.
% Normalizar a planta de la forma Kg/(s-pg) = (Km/tau)/(s - (-1/tau)) = Km/(tau*s + 1)
Kg = Km/tau;
pg = -1/tau;

clearvars -except Kg pg Ts aproximacion decimales tiempos_sim salidas_sim errores_SA acciones_SA salidas_SA errores_CA acciones_CA salidas_CA eje_tiempos_fase3 errores_SA_f5 acciones_SA_f5 salidas_SA_f5 errores_CA_f5 acciones_CA_f5 salidas_CA_f5 eje_tiempos_fase5;
%%
% Aproximación del BoG, teniendo en cuenta el retardo adicional

G = tf(Kg, [1 -pg]);
retardo = tf(1, [1 0], Ts);
BoG = series(c2d(G, Ts), retardo) %[output:7fad78de]
[NumBoG, DenBoG] = tfdata(BoG, 'v');

% Especificaciones deseadas
ts = 0.980;
erpp = 0.03;

% Calculo diferencias de grados
grado_Den_BoG = length(DenBoG) - find(DenBoG ~= 0, 1, 'first');
grado_Num_BoG = length(NumBoG) - find(NumBoG ~= 0, 1, 'first');
dif_grados_G = grado_Den_BoG - grado_Num_BoG;
retardos = dif_grados_G - 1;

% Calculo de parámetros
ts_prima = ts - retardos*Ts;
pm = exp(Ts * aproximacion / ts_prima); % Ignorando solución negativa por "no ser práctica"
km = (1-pm)*(1-erpp);

fprintf("===== MÉTODO DE TRUXAL =====\n" + ... %[output:group:625ec19e] %[output:37303d7a]
    "1. Aplicabilidad del modelo. Aplicable por entrada al escalón y singularidades que la unidad\n" + ... %[output:37303d7a]
    "2. Causalidad: Diferencia de grados = %d\n" + ... %[output:37303d7a]
    "3. Modelo genérico. Se genera un modelo sobreamortiguado teniendo en cuenta la diferencia de grados del paso anterior\n" + ... %[output:37303d7a]
    "\t Parámetros: pm = %.0" + decimales + "f\tkm=%.0" + decimales + "f", ... %[output:37303d7a]
    dif_grados_G, pm, km); %[output:group:625ec19e] %[output:37303d7a]

M_obj = zpk(tf(km, [1, -pm], Ts)*(tf(1, [1 0], Ts)^retardos)) %[output:4c504716]

fprintf("4. Cálculo del controlador") %[output:01a5521d]
F = zpk(minreal(M_obj/(BoG * (1 - M_obj)))) %[output:37f304f2]
F = tf(F) %[output:479e6978]
get_eq_diff(F, decimales, 'e', 'a') %[output:9c26fe23]
%%
%[text] **Ejercicio 7**
%[text] Dibuje una topología (diagrama de bloques) del sistema de acuerdo a las unidades elegidas, que deberán aparecer indicadas en cada señal o secuencia del dibujo.
%[text] ![](text:image:5390)
%%
%[text] **Ejercicio 8**
%[text] Calcule la FdeT del sistema y caracterice teóricamente su salida ante entradas escalón de ±1 m/s.
fprintf("Valor de FdeT del sistema controlado") %[output:62c65dee]
M_final = zpk(minreal(feedback(series(F, BoG), 1))) %[output:469ab3a8]
p_m_final = pole(M_final);


ts_M = Ts * (ceil(round(aproximacion / log(max(p_m_final)), 10)) + (length(p_m_final) - 1)); % ceil(round(...)) para evitar que x + 1e-12 suba a x + 1
Km_final = dcgain(M_final); % lim_(z->1) M_final
c_inf_mas_1V   = Km_final * 1;
c_inf_menos_1V = Km_final * (-1);

fprintf("Caracterización de salida frente a escalón") %[output:7e435a3e]
fprintf("Escalón de  1 m/s:\tc(inf)=%.0"+decimales+"f m/s, ts=%.0"+decimales+"f s", c_inf_mas_1V,   ts_M); %[output:9e3ca909]
fprintf("Escalón de -1 m/s:\tc(inf)=%.0"+decimales+"f m/s, ts=%.0"+decimales+"f s", c_inf_menos_1V, ts_M); %[output:442d998d]
%%
%[text] **Ejercicio 9**
%[text] Calcule en régimen permanente tanto la acción de control como la velocidad de la escalera subiendo y bajando en diferentes condiciones de carga de la escalera, para consignas de ±1 m/s. Relacione los incrementos o decrementos de acción de control con el peso de las personas presentes en la escalera.
pert_5personas = -0.1;
pert_10personas = -0.2;
%[text] Aplicando teorema de superposición
M_r = M_final;
M_p = zpk(minreal(feedback(1, series(F, BoG))));
%[text] La perturbación no afecta al tiempo de establecimiento, solo al valor final (y por tanto al error)
K0_ref = dcgain(M_r);
K0_pert= dcgain(M_p);
K0_F   = dcgain(F);

entradas             = [1 -1];
perturbaciones       = [0 -0.1 -0.2];
perturbaciones_names = [" 0 personas", " 5 personas", "10 personas"];

fprintf("Cálculo de error y acción en régimen permanente para distintas perturbaciones\n") %[output:240d3834]

for i = 1:length(entradas) %[output:group:92e7ef2a]
    fprintf("\nPara escalón de %0.2fV:\n", entradas(i)) %[output:979365f1] %[output:2ec12627]
    for j = 1:length(perturbaciones)
        r = entradas(i);
        p = perturbaciones(j);

        c = K0_ref * r + K0_pert * p;
        e = r - c;
        a = K0_F * e;

        fprintf("\tCon %s:\tc_inf=%.0" + decimales + "f\terpp=%.0" + decimales + "f\ta_inf=%.0" + decimales + "f\n", perturbaciones_names(j), c, e, a); %[output:632d79fc] %[output:025a46e6]
    end
end %[output:group:92e7ef2a]
%%
%[text] ## Fase 3
%[text] **Ejercicio 10**
%[text] Simule en Simulink el sistema de control con y sin alinealidades. Mida las características  de las respuestas (tanto el régimen permanente como el transitorio) ante entradas escalón  de ±1 m/s. Analice las diferencias de las medidas respecto de los cálculos teóricos.
if ~exist("acciones_SA", 'var') % evita simular todo el rato
    open_system("Fase3/modeloSimulink");
    
    % Controlador 
    % SA ≡ Sin Alinealidades, CA ≡ Con Alinealidades
    [N,D] = tfdata(F, 'v');
    set_param("modeloSimulink/Controlador - SA", 'Numerator', '[' + strjoin(string(N)) + ']', 'Denominator', '[' + strjoin(string(D)) + ']')
    set_param("modeloSimulink/Controlador - CA", 'Numerator', '[' + strjoin(string(N)) + ']', 'Denominator', '[' + strjoin(string(D)) + ']')
    
    % Planta
    [N,D] = tfdata(G, 'v');
    set_param("modeloSimulink/Planta - CA", 'Numerator', '[' + strjoin(string(N)) + ']', 'Denominator', '[' + strjoin(string(D)) + ']')
    set_param("modeloSimulink/Planta - CA", 'Numerator', '[' + strjoin(string(N)) + ']', 'Denominator', '[' + strjoin(string(D)) + ']')
    
    sim("modeloSimulink")
    errores_SA  = zeros(length(SA.signals(1).values),1);
    acciones_SA = zeros(length(SA.signals(1).values),1);
    salidas_SA  = zeros(length(SA.signals(1).values),1);
    errores_CA  = zeros(length(CA.signals(1).values),1);
    acciones_CA = zeros(length(CA.signals(1).values),1);
    salidas_CA  = zeros(length(CA.signals(1).values),1);
    eje_tiempos_fase3 = CA.time; % Igual para Con/Sin Alinealidades y las distintas señales
    
    % Simular
    for i = 1:length(entradas) % ± 1m/s
        set_param("modeloSimulink/Ref - SA", 'After', string(entradas(i)))
        set_param("modeloSimulink/Ref - CA", 'After', string(entradas(i)))
    
        for j = 1:length(perturbaciones)
            perturbacion = perturbaciones(j);
            set_param("modeloSimulink/Personas - SA", 'After', string(perturbacion))
            set_param("modeloSimulink/Personas - CA", 'After', string(perturbacion))
            sim("modeloSimulink")
            
            errores_SA (:, 3*(i - 1) + j) = SA.signals(1).values;
            acciones_SA(:, 3*(i - 1) + j) = SA.signals(2).values;
            salidas_SA (:, 3*(i - 1) + j) = SA.signals(3).values;

            errores_CA (:, 3*(i - 1) + j) = CA.signals(1).values;
            acciones_CA(:, 3*(i - 1) + j) = CA.signals(2).values;
            salidas_CA (:, 3*(i - 1) + j) = CA.signals(3).values;
        end
    end
end

% Representar
for i = 1:length(entradas) %[output:group:3a8e8e9b]
    for j = 1:length(perturbaciones)
        % Sin alinealidades
        figure %[output:63735d56] %[output:408174f9] %[output:4d060cdb] %[output:593926ab] %[output:1c07d8cc] %[output:1e7392e0]
        sgtitle("Consigna " + entradas(i) + " m/s, carga de " + perturbaciones_names(j) + " - Sin alinealidades") %[output:63735d56] %[output:408174f9] %[output:4d060cdb] %[output:593926ab] %[output:1c07d8cc] %[output:1e7392e0]
        subplot(1, 2, 1)
        hold on
        stairs(eje_tiempos_fase3,  errores_SA(:, 3*(i - 1) + j))
        stairs(eje_tiempos_fase3,  salidas_SA(:, 3*(i - 1) + j))
        legend("error [m/s]", "salida [m/s]", Location="east")
        xlabel("tiempo (s)")
        ylabel("[m/s]")
        subplot(1, 2, 2)
        stairs(eje_tiempos_fase3, acciones_SA(:, 3*(i - 1) + j), Color="m")
        legend("acción [V]", Location="east")
        xlabel("tiempo (s)")
        ylabel("[V]")

        % Con alinealidades
        figure %[output:7003709f] %[output:062b6eda] %[output:01f2ed9c] %[output:677d829e] %[output:64eaade0] %[output:892ecde2]
        sgtitle("Consigna " + entradas(i) + " m/s, carga de " + perturbaciones_names(j) + " - Con alinealidades") %[output:7003709f] %[output:062b6eda] %[output:01f2ed9c] %[output:677d829e] %[output:64eaade0] %[output:892ecde2]
        subplot(1, 2, 1)
        hold on
        stairs(eje_tiempos_fase3, errores_CA (:, 3*(i - 1) + j))
        stairs(eje_tiempos_fase3, salidas_CA (:, 3*(i - 1) + j))
        legend("error [m/s]", "salida [m/s]", Location="east")
        xlabel("tiempo (s)")
        ylabel("[m/s]")
        subplot(1, 2, 2)
        stairs(eje_tiempos_fase3, acciones_CA(:, 3*(i - 1) + j), Color="m")
        legend("acción [V]", Location="east")
        xlabel("tiempo (s)")
        ylabel("[V]")

        % Diferencia entre Sin y Con alinealidades
        figure %[output:9bea7fee] %[output:99c51a3e] %[output:2da8d1bb] %[output:5d041e74] %[output:22f11e5a] %[output:8bd88e08]
        sgtitle("Consigna " + entradas(i) + " m/s, carga de " + perturbaciones_names(j) + " - Diferencia") %[output:9bea7fee] %[output:99c51a3e] %[output:2da8d1bb] %[output:5d041e74] %[output:22f11e5a] %[output:8bd88e08]
        subplot(1, 2, 1)
        hold on
        stairs(eje_tiempos_fase3, errores_CA (:, 3*(i - 1) + j) - errores_SA (:, 3*(i - 1) + j))
        stairs(eje_tiempos_fase3, salidas_CA (:, 3*(i - 1) + j) - salidas_SA (:, 3*(i - 1) + j))
        legend("error [m/s]", "salida [m/s]", Location="southeast")
        xlabel("tiempo (s)")
        ylabel("[m/s]")
        subplot(1, 2, 2)
