    sim("modeloSimulink")
    errores_SA_f5  = zeros(length(SA.signals(1).values),1);
    acciones_SA_f5 = zeros(length(SA.signals(1).values),1);
    salidas_SA_f5  = zeros(length(SA.signals(1).values),1);
    errores_CA_f5  = zeros(length(CA.signals(1).values),1);
    acciones_CA_f5 = zeros(length(CA.signals(1).values),1);
    salidas_CA_f5  = zeros(length(CA.signals(1).values),1);
    eje_tiempos_fase5 = CA.time; % Igual para Con/Sin Alinealidades y las distintas señales
    
    % Simular
    for i = 1:length(entradas) % ± 1m/s
        set_param("modeloSimulink/Ref - SA", 'After', string(entradas(i)))
        set_param("modeloSimulink/Ref - CA", 'After', string(entradas(i)))
    
        for j = 1:length(perturbaciones)
            perturbacion = perturbaciones(j);
            set_param("modeloSimulink/Personas - SA", 'After', string(perturbacion))
            set_param("modeloSimulink/Personas - CA", 'After', string(perturbacion))
            sim("modeloSimulink")
            
            errores_SA_f5 (:, 3*(i - 1) + j) = SA.signals(1).values;
            acciones_SA_f5(:, 3*(i - 1) + j) = SA.signals(2).values;
