     1,  5.29; ...  1m/s,  5 personas
     1,  5.78; ...  1m/s, 10 personas
    -1, -4.81; ... -1m/s,  0 personas
    -1, -4.32; ... -1m/s,  5 personas
    -1, -3.84; ... -1m/s, 10 personas
];
for i = 1:length(entradas) %[output:group:1d987d5c]
    for j = 1:length(perturbaciones)
        fprintf("Consigna " + entradas(i) + " m/s, carga de " + perturbaciones_names(j) + " - Sin alinealidades: " + ... %[output:2809ed85] %[output:94b851a2] %[output:163d54e6] %[output:851638b4] %[output:7c176154] %[output:2afc0d5f]
            "\n\tSalida de: " + salidas_SA_f5(end, 3*(i - 1) + j) + " m/s en RP" + ... %[output:2809ed85] %[output:94b851a2] %[output:163d54e6] %[output:851638b4] %[output:7c176154] %[output:2afc0d5f]
            "\n\tAcción de: " + acciones_SA_f5(end, 3*(i - 1) + j) + " V en RP\n") %[output:2809ed85] %[output:94b851a2] %[output:163d54e6] %[output:851638b4] %[output:7c176154] %[output:2afc0d5f]
        
        fprintf("Consigna " + entradas(i) + " m/s, carga de " + perturbaciones_names(j) + " - Con alinealidades:" + ... %[output:7cca279c] %[output:40ce3a71] %[output:51f8bdf2] %[output:3c369286] %[output:923e12ac] %[output:6c68df1a]
            "\n\tSalida de: " + salidas_CA_f5(end, 3*(i - 1) + j) + " m/s en RP" + ... %[output:7cca279c] %[output:40ce3a71] %[output:51f8bdf2] %[output:3c369286] %[output:923e12ac] %[output:6c68df1a]
            "\n\tAcción de: " + acciones_CA_f5(end, 3*(i - 1) + j) + " V en RP\n") %[output:7cca279c] %[output:40ce3a71] %[output:51f8bdf2] %[output:3c369286] %[output:923e12ac] %[output:6c68df1a]
        
        fprintf("Consigna " + gui_control(3*(i - 1) + j, 1) + " m/s, carga de " + perturbaciones_names(j) + " - Resultado GUI:" + ... %[output:611942e8] %[output:009c2614] %[output:9052bf68] %[output:7e237cf1] %[output:0e7b5307] %[output:632acfce]
            "\n\tSalida de: " + c_inf(3*(i-1) + j) + " m/s en RP (media ultimas 20 muestras)" + ... %[output:611942e8] %[output:009c2614] %[output:9052bf68] %[output:7e237cf1] %[output:0e7b5307] %[output:632acfce]
            "\n\tAcción de: " + gui_control(3*(i - 1) + j, 2) + " V en última muestra\n \n ") %[output:611942e8] %[output:009c2614] %[output:9052bf68] %[output:7e237cf1] %[output:0e7b5307] %[output:632acfce]
    end
end %[output:group:1d987d5c]


